tables.table_schema:
CREATE TABLE UserBehaviors (
    behavior_id UUID PRIMARY KEY,
    user_id UUID REFERENCES UserProfiles(user_id),
    behavior_type VARCHAR(50),
    timestamp TIMESTAMP
);

CREATE TABLE PersonalizationData (
    personalization_id UUID PRIMARY KEY,
    user_id UUID REFERENCES UserProfiles(user_id),
    preference VARCHAR(100),
    score DECIMAL
);

CREATE TABLE user_behavior (
    behavior_id INT PRIMARY KEY,
    user_id INT REFERENCES users(user_id),
    action VARCHAR(50) NOT NULL,
    timestamp TIMESTAMP
);

CREATE TABLE user_preferences (
    preference_id INT PRIMARY KEY,
    user_id INT REFERENCES users(user_id),
    preference_name VARCHAR(100),
    preference_value VARCHAR(255)
);

CREATE TABLE user_profiles (
    user_id UUID PRIMARY KEY,
    username VARCHAR(255) NOT NULL,
    email VARCHAR(255) UNIQUE,
    age INT
);

CREATE TABLE user_preferences (
    user_id UUID PRIMARY KEY,
    theme VARCHAR(50),
    language VARCHAR(50) NOT NULL
);

CREATE TABLE user_history (
    event_id SERIAL PRIMARY KEY,
    user_id UUID,
    event_type VARCHAR(50) NOT NULL,
    event_timestamp TIMESTAMP
);

CREATE TABLE user_interactions (
    interaction_id SERIAL PRIMARY KEY,
    user_id UUID,
    interaction_type VARCHAR(50) NOT NULL,
    interaction_timestamp TIMESTAMP
);

CREATE TABLE user_recommendations (
    recommendation_id SERIAL PRIMARY KEY,
    user_id UUID,
    recommendation_type VARCHAR(50) NOT NULL,
    recommendation_timestamp TIMESTAMP
);
